from secret import flag
from Crypto.Util.number import bytes_to_long,getPrime

assert flag[:5]==b'QLNU{' and flag[-1:]==b'}'
m = bytes_to_long(flag)


p = getPrime(1024)
q = getPrime(768)

hint = p**3 + q**2 + 647**6 + 653522531*15 + 9
n = p * q
e = 65537
c = pow(m,e,n)




print('e =',e)
print('c =',c)
print('hint =',hint)
print('n =',n)

